INSERT INTO `products` VALUES (1,'Túi Đeo Chéo Nam Thể Thao US ARMY, Túi Đeo Bao Tử  Đeo Bụng Lính Mỹ Phong Cách Chất Vải Kaki Cao Cấp Chồng Nước Nhẹ - HÀNG CHÍNH HÃNG','<p><strong>CAM KẾT CỦA USARMY:</strong></p>\n<p>HÀNG CHUẨN NHƯ HÌNH</p>\n<p>HOÀN 100% GIÁ TRỊ ĐƠN HÀNG NẾU KHÔNG GIỐNG MÔ TẢ</p>\n<p>HỖ TRỢ MIỄN PHÍ ĐỔI - TRẢ SẢN PHẨM MỌI TRƯỜNG HỢP.</p>\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/8c/67/ac/0a02fabce4c5b91df958072cd8fa9472.jpg\" alt=\"\" width=\"750\" height=\"750\" /></p>\n<p><strong>CHI TIẾT:</strong></p>\n<p> - Túi Đeo chéo nam Lính Mỹ thiết kế đẳng cấp dành cho phái mạnh thể hiện sự mạnh mẽ, khoẻ khoắn, chất liệu túi vải kaki cao cấp luôn giữ được From, Vải dệt từ sợi bông thiên nhiên bền chắc và màu sắc sắc nét</p>\n<p> - Túi Đeo Bao Tử Phượt thiết kế Sắc sảo, đẹp mắt, tỉ mỉ trong từng chi tiết đạt tiêu chuẩn xuất khẩu, thể hiện được đẳng cấp của sản phẩm. </p>\n<p> - Túi Đeo Hông nam Chiến Thuật khá dễ dàng trong việc kết hợp với các loại quần áo khác nhau như áo thun, áo Phông, quần jean, quần túi hộp để có được một phong cách</p>\n<p> - Những chàng trai hay chơi thể dục thể thao, hay đi du lịch, đi phượt hoặc dùng thường ngày … thì không thể thiếu được món phụ kiện tiện dụng này.</p>\n<p>- Phong cách lính mỹ US ARMY !</p>\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/c1/75/15/4fad8d997ad6c3effa0156b55d489b7e.jpg\" alt=\"\" width=\"750\" height=\"750\" /></p>\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/d8/b5/a3/dd4824dc2b84a48351928b27f73e045f.jpg\" alt=\"\" width=\"750\" height=\"750\" /></p>\n<p><strong>CHẤT LIỆU: </strong></p>\n<p>- Vải dù chắc chắn bền màu không nát from</p>\n<p>- Chất vải thiết kế dùng cho du lịch nên sẽ chống nước nhẹ</p>\n<h4>Thông số kỹ thuật</h4>\n<p>- Chiều dài 19 cm</p>\n<p>- Chiều rộng 16 cm </p>\n<p>- Độ dày 9 cm</p>\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/8b/81/e1/1a7a2be16be0bade232fb3cde7d6fb67.jpg\" alt=\"\" width=\"750\" height=\"750\" /></p>\n<p><strong>HƯỚNG DẪN MIX ĐỒ: </strong></p>\n<p>- Mix đồ Túi đeo chéo phong cách lính Quá dễ và quá nhiều cách có thể phối được!</p>\n<p>- Quần dài , quần short đều được, quần kaki quần jean cũng hay!</p>\n<p>- Theo Shop thấy thì nên phối theo 2 cách này có vẻ ok.</p>\n<p>1 Là tông xuyệt tông tiếng tây là ton sur ton : nghĩa là đồ chính màu gì thì phụ kiện đi kèm màu đó!</p>\n<p>2 Là phối kiểu tương phản: Nghĩa là đồ chính thế nào thì phụ kiện sẽ ngược lại</p>\n<p> </p>\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/84/3b/f5/9439ee349bbac2e03429a4dd9c0d96ea.jpg\" alt=\"\" width=\"750\" height=\"750\" /></p>\n<p><strong>CHÍNH SÁCH ĐỔI- TRẢ:</strong></p>\n<p>+ US ARMY hỗ trợ đổi- trả trong mọi trường hợp: mặc không vừa, không ưng sản phẩm đã đặt, muốn đổi sang sản phẩm khác, khi sản phẩm còn nguyên tem mác và chưa qua sử dụng.</p>\n<p>+ Nếu có bất kì khiếu nại cần US ARMY hỗ trợ về sản phẩm, khi MỞ sản phẩm Quý khách NÊN quay lại video quá trình mở hàng để được đảm bảo 100% vấn đề sẽ được giải quyết.</p>\n<p><strong>ƯU ĐÃI KHI MUA TẠI US ARMY:</strong></p>\n<p>+ Click “Theo dõi” shop để nhận ngay VOUCHER giảm giá.</p>\n<p>** US ARMY cảm ơn quý khách hàng đã tin tưởng và đồng hành cùng shop. Chúc bạn có một ngày mua sắm thật thoải mái cùng Shop nhé! Đừng ngần ngại nhắn tin cho shop để được hỗ trợ nhanh nhất bạn nhé!</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>','2022-07-21',2,1,NULL),(2,'Túi xách túi đeo chéo nam vải canvas cao cấp phong cách mới','<p>Kích thước : rộng 29cm ,cao 35cm,dày 13cm<br />Phương pháp sản xuất: công nghệ cao<br />Chất liệu : Vải Canvas<br />Chức năng: Không thấm nước nhẹ, thoáng khí, chống mài mòn, làm sáng, chống sốc<br />thiết kế : hiện đại,trẻ trung,sang trọng</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>','2021-04-07',2,2,1),(3,'Túi Nam Đeo Chéo Trước Ngực 4U Da Tổng Hợp Cao Cấp Thời Trang Đựng Vừa Ipad Mini Nhiều Ngăn Tiện Dụng BA416','<p style=\"text-align:center;\"><strong>Túi Đeo Chéo Trước Ngực 4U Da Tổng Hợp Thời Trang BA416</strong> là phụ kiện thời trang nam hiện đại năng động được các bạn nam yêu thích bởi sự tiện dụng và năng động khi đi ra ngoài, dạo phố, dã ngoại đều giúp các chàng trai thêm phần gọn gàng và nam tính.<em> </em></p>\n<p style=\"text-align:center;\"><em><img src=\"https://salt.tikicdn.com/ts/tmp/be/49/08/cc744b4208d1f331da03300414b28534.jpg\" alt=\"\" width=\"750\" height=\"467\" /></em></p>\n<p style=\"text-align:center;\"><em><img src=\"https://salt.tikicdn.com/ts/tmp/62/d0/e8/15ec82aebc9f08b51495f0292f0627e4.jpg\" alt=\"\" width=\"750\" height=\"191\" /></em></p>\n<p style=\"text-align:center;\"><em><img src=\"https://salt.tikicdn.com/ts/tmp/10/c4/c5/3ec2e24e77be92578cf0eda363ede3b7.jpg\" alt=\"\" width=\"750\" height=\"393\" /></em></p>\n<p style=\"text-align:center;\"><em><img src=\"https://salt.tikicdn.com/ts/tmp/83/ae/9e/021dcfcff605a2957b3813518dc76068.jpg\" alt=\"\" width=\"750\" height=\"50\" /></em></p>\n<p style=\"text-align:center;\"><em><img src=\"https://salt.tikicdn.com/ts/tmp/02/86/b0/fe031fc07c5a0968fddaba8eab89adc6.jpg\" alt=\"\" width=\"750\" height=\"2352\" /></em></p>\n<p style=\"text-align:center;\"><em><img src=\"https://salt.tikicdn.com/ts/tmp/4b/5b/6e/4dcf43c4e430162b9a0fada689c3208a.jpg\" alt=\"\" width=\"750\" height=\"665\" /></em></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>','2020-10-13',2,3,2),(4,'Túi Đeo Chéo Canvas Messenger Ipad Oxford Cao Cấp Màu Đen Có Dây Kéo Và Ngăn Phụ Trong Ngoài Thời Trang Cá Tính','<p><strong>Túi đeo chéo mẫu Messenger Ipad Oxford: </strong></p>\n<p>- Bên trong được phân chia ngăn rất hợp lý giúp bạn có thể đựng được nhiều vật dụng cá nhân: iPad, các loại smartphone, sổ tay hay sách một cách gọn gàng. Chất liệu vải sang trọng, tinh tế cùng với đường may chắc chắn, tỉ mỉ.</p>\n<p>- Mẫu túi đeo chéo thiết kế rất tiện ích mặc dù đơn giản, không cầu kỳ nhưng mẫu túi Messenger iPad Oxford lại nổi bật. Mẫu túi đeo chéo rất \"trend\", hiện đại, dễ dàng phối với nhiều loại outfit.</p>\n<p>- Túi đeo chéo mẫu Messenger Ipad Oxford phù hợp với các bạn trẻ năng động, có thể dùng cho cả nam lẫn nữ. Những ai đam mê thời trang cá tính, năng động</p>\n<p><iframe title=\"YouTube video player\" src=\"//www.youtube.com/embed/lHjpJ3JvsD0\" width=\"860\" height=\"484\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p style=\"text-align: center;\"><em><strong>Video chi tiết về túi đeo chéo nam nữ unisex vải bố canvas chống nước</strong></em></p>\n<p style=\"text-align: center;\"><em><strong><img src=\"https://salt.tikicdn.com/ts/tmp/76/1d/76/b3045c917ad85bc98f2dfdc06b45825b.jpg\" alt=\"\" width=\"750\" height=\"749\" /></strong></em></p>\n<p style=\"text-align: center;\"><em><strong>Túi đeo chéo đi học</strong></em></p>\n<p style=\"text-align: center;\"><em><strong><img src=\"https://salt.tikicdn.com/ts/tmp/1e/06/28/98f3dff21ab0415be7beb4264fbe25f8.jpg\" alt=\"\" width=\"601\" height=\"840\" /></strong></em></p>\n<p style=\"text-align: center;\"><em><strong>Túi đeo nam thời trang</strong></em></p>\n<p style=\"text-align: center;\"><em><img src=\"https://salt.tikicdn.com/ts/tmp/11/ac/3c/842c6f211e7a08a2053c9999b1d6bc86.jpg\" alt=\"\" width=\"750\" height=\"680\" /></em></p>\n<p style=\"text-align: center;\"><em><img src=\"https://salt.tikicdn.com/ts/tmp/4f/c2/8c/602ad4b8a2e0b56ac6ba3a58267bb5c9.jpg\" alt=\"\" width=\"750\" height=\"749\" /></em></p>\n<p style=\"text-align: center;\"><strong><em>Túi đeo chéo đi học</em></strong></p>\n<p style=\"text-align: center;\"><strong><em><img src=\"https://salt.tikicdn.com/ts/tmp/64/6f/2c/8f39cda058eb96c066cbe572794b1a7a.jpg\" alt=\"\" width=\"750\" height=\"749\" /></em></strong></p>\n<p style=\"text-align: center;\"><strong><em>Túi xách đeo chéo</em></strong></p>\n<p style=\"text-align: center;\"><strong><em><img src=\"https://salt.tikicdn.com/ts/tmp/93/ba/4f/0b2efea4e7c70af3da25545bcedba851.jpg\" alt=\"\" width=\"750\" height=\"749\" /></em></strong></p>\n<p style=\"text-align: center;\"><strong><em>Túi đeo chéo nam</em></strong></p>\n<p style=\"text-align: center;\"><strong><em><img src=\"https://salt.tikicdn.com/ts/tmp/9f/9f/0d/ae43ada95e2bdcf7cedfdb6c3f6b598f.jpg\" alt=\"\" width=\"750\" height=\"749\" /></em></strong></p>\n<p style=\"text-align: center;\"><strong><em>Túi đeo chéo unisex nam nữ</em></strong></p>\n<p style=\"text-align: center;\"><strong><em><img src=\"https://salt.tikicdn.com/ts/tmp/53/5c/d5/88688e85bc6a8f78e7df6ca41fdd94d3.jpg\" alt=\"\" width=\"750\" height=\"749\" /></em></strong></p>\n<p style=\"text-align: center;\"><strong><em>Túi đựng điện thoại nam nữ</em></strong></p>\n<p style=\"text-align: center;\"><strong><em><img src=\"https://salt.tikicdn.com/ts/tmp/22/44/05/d350ba0d53253ca3f59b7bb27287cd97.jpg\" alt=\"\" width=\"750\" height=\"749\" /></em></strong></p>\n<p style=\"text-align: center;\"><strong><em>Túi đeo chéo nữ đi học</em></strong></p>\n<p>Túi đeo chéo unisex vải bố canvas với phong cách Hàn Quốc. Những mẫu túi đeo chéo nam chống nước, túi đeo chéo nữ mini hay túi bao tử nam được bạn trẻ yêu thích. Dòng túi đựng điện thoại kiểu dáng túi đeo hông nam, túi đeo bụng nam cá tính dùng làm túi du lịch nam rất được ưa chuộng. Đối với phái đẹp, mẫu túi đeo chéo nữ vải canvas Hàn Quốc biến tấu dạng túi xách đeo chéo nữ hoặc dạng túi điện thoại đeo chéo nữ.</p>\n<p><strong>Cách chọn túi nam đeo chéo</strong></p>\n<p>Xu hướng thời trang túi đeo nam là túi tote đeo chéo hay còn gọi là túi vải đeo chéo. Các chàng trai yêu thích các sản phẩm: túi đeo chéo nam đựng tiền, túi đeo chéo đi học, túi đựng điện thoại nam, túi đeo ngang bụng nam, túi đeo chéo bao tử nam. Đối với những bạn thích năng động thì thường chọn: túi đeo ngang hông đựng điện thoại, túi xách du lịch nam, túi đeo bao tử nam, túi phụ kiện du lịch, túi đeo chéo nam vuông. Một túi xách nam đeo chéo toàn diện hơn với túi đựng đa năng, túi đeo đựng điện thoại cho nam, túi nhỏ đựng phụ kiện, túi đựng tiền.</p>\n<p><strong>Xu hướng thời trang túi xách nữ đeo chéo</strong></p>\n<p>Đối với túi vải đeo chéo nữ với các mẫu túi phổ biến: túi xách nữ đeo chéo, túi đeo bao tử nữ, túi canvas nữ đeo chéo, túi đựng điện thoại nữ có dây đeo. Những dòng sản phẩm thời trang được phái đẹp lựa chọn: túi đeo chéo mini nữ, túi đeo chéo nữ size nhỏ, túi đeo chéo nữ cá tính. Đối với bạn nữ năng động: túi đeo điện thoại nữ, túi đeo chéo bằng vải, túi vải đeo chéo nữ size lớn, túi đeo chéo nữ đi học, túi bao tử thể thao nữ</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>','2020-10-23',2,4,NULL),(5,'Ví Nam, Nữ Cầm Tay Cao Cấp VinBuy – Bóp Nam, Nữ Kiểu Dáng Sang Trọng Cao Cấp Dành Cho Doanh Nhân – Hàng Chính Hãng VinBuy','<p style=\"text-align: center;\"><strong>Ví Nam, Nữ Cầm Tay Cao Cấp VinBuy </strong><br /><strong>Bóp Nam, Nữ Kiểu Dáng Sang Trọng Cao Cấp Dành Cho Doanh Nhân </strong></p>\n<p>Không chỉ là phụ kiện đơn thuần để cất giữ tiền bạc cũng như giấy tờ cần thiết, ví da nam còn được xem như người bạn đồng hành cùng các chàng trai. Thời gian sử dụng ví da nam càng lâu thì càng bóng đẹp, mềm mại và có sự thay đổi về màu 