cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>','2022-07-14',5,2,NULL),(27,'Ví Nam Ngang Cao Cấp Sang Trọng, Chất Liệu Bền Đẹp, Ví Da Nam, Ví Nam Cầm Tay Nhiều Ngăn Tiện Lợi - Hàng chính hãng','<p style=\"text-align: center;\"><strong>Ví Nam VinBuy Cao Cấp Bền Đẹp, Ví Da Nam Dáng Ngang, Ví Nam Cầm Tay Nhiều Ngăn Tiện Lợi - Hàng chính hãng</strong></p>\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/3d/44/fc/d0653e5b9a1b7cf3db67d5817bedce3d.png\" alt=\"\" width=\"736\" height=\"680\" /></p>\n<p>Nếu nhìn vào những bộ trang phục hay những phụ kiện như ví nam, giày  bạn cũng có thể phần nào đó đoán được tính cách của một anh chàng nào đó. Những phụ kiện nhất là những chiếc ví nam tuy được thiết kế đơn giản, cổ điển đâu đó nhấn nhá những đường nét tinh tế hay logo thương hiệu. Nhưng luôn có một nét đẹp riêng và tôn lên được cá tính và sự nam tính, phong độ của các chàng</p>\n<p>Thiết kế đơn giản, nam tính</p>\n<p>Ví nam VINBUY thanh lịch được thiết kế đơn giản với 3 ngăn lớn nhỏ vô cùng tiện dụng và thời trang. Đường chỉ may chắc chắn, tinh tế tạo sự an tâm cho phái mạnh khi sử dụng, kéo dài tuổi thọ sản phẩm. Ví được thiết kế dạng gập đôi cổ điển mang lại một phong cách mới lạ và hết sức cá tính cho các chàng.</p>\n<p>Chất liệu da bền, chắc chắn</p>\n<p>Chất liệu da bền, đẹp, không phai màu theo thời gian, giúp sản phẩm sử dụng được lâu dài. Các sản phẩm làm từ da PU luôn được đông đảo người tiêu dùng ưa chuộng bởi có nhiều ưu điểm như bền, sử dụng được lâu. Nếu chàng đang tìm kiếm cho bản thân một chiếc ví phù hợp thì hãy thử chiếc ví này nhé.</p>\n<p><img id=\"https://salt.tikicdn.com/ts/tmp/af/15/3e/a9a62a1b7c9265a55f8257c21fff275e.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/tmp/af/15/3e/a9a62a1b7c9265a55f8257c21fff275e.jpg\" alt=\"\" width=\"750\" height=\"750\" /></p>\n<p><img id=\"https://salt.tikicdn.com/ts/tmp/5e/2b/a2/c23867c1911f9b191bbb0c70765fe0c5.jpg\" title=\"\" src=\"https://salt.tikicdn.com/ts/