jpg\" alt=\"bên trong túi đeo chéo\" width=\"750\" height=\"916\" /></span></p>\n<p><span style=\"font-weight: 400;\">Điểm nhấn đặc biệt của bạn mỗi khi ra đường, trông bạn thật năng động trẻ trung</span></p>\n<p><span style=\"font-weight: 400;\">Thiết kế + chất vải mới nhất thị trường sẽ không làm bạn thất vọng.</span></p>\n<p><span style=\"font-weight: 400;\">Túi Balo Đeo Chéo Thể Thao 2020</span></p>\n<p><strong>I. TẠI SAO LẠI LỰA CHỌN MẪU TÚI ĐEO CHÉO DÒNG GISBAG ?</strong></p>\n<p><span style=\"font-weight: 400;\">✦ Bề mặt vải mềm mịn không bị thô như các loại vải canvas hay polyester thường</span></p>\n<p><span style=\"font-weight: 400;\">✦ Thiết kế thời trang, phong cách phù hợp với nhiều đối tượng</span></p>\n<p><span style=\"font-weight: 400;\">✦ Chất liệu vải nylon kết polyester cao cấp </span></p>\n<p><span style=\"font-weight: 400;\">✦ Sụ lựa chọn thay thế cho chiếc bolo cồng kềnh</span></p>\n<p><span style=\"font-weight: 400;\">✦ Màu đen dễ dàng phối với mọi trang phục</span></p>\n<p><span style=\"font-weight: 400;\">✦ Ngăn rộng để được nhiều đồ hơn</span></p>\n<p><span style=\"font-weight: 400;\">✦ Chống nước, chống nhăn, chống xù</span></p>\n<p><span style=\"font-weight: 400;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://salt.tikicdn.com/ts/tmp/ff/81/e4/da05c4e4998db9e08af5557a2f62d725.jpg\" alt=\"kiểu dáng túi đeo chéo nam td30\" width=\"750\" height=\"1293\" /></span></p>\n<p><span style=\"font-weight: 400;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://salt.tikicdn.com/ts/tmp/51/c4/8c/f8c9c8cf6ef1743a11464d41925cb19b.jpg\" alt=\"kích thước túi chuẩn \" width=\"750\" height=\"750\" /></span></p>\n<p><strong>II. THÔNG SỐ KỸ THUẬT TÚI ĐEO </strong></p>\n<p><span style=\"font-weight: 400;\">______________</span></p>\n<p><span style=\"font-weight: 400;\">✦  Kích thước chuẩn : 30 x 20 x 10 ( cm )</span></p>\n<p><span style=\"font-weight: 400;\">✦ Đựng điện thoại, ipad, giáo trình, sổ tay và nhiều vật dụng khác</span></p>\n<p><span style=\"font-weight: 400;\">✦ Chất liệu : Vải nylon + polyester dệt trơn trượt nước </span></p>\n<p><span style=\"font-weight: 400;\">✦ Cấu tạo 3 lớp : 2 lớp vải, 1 lớp phao ở giữa tạo độ êm cho túi</span></p>\n<p><span style=\"font-weight: 400;\">✦ Móc khóa dễ tháo lắp chất liệu inox chống gỉ sơn đen tĩnh điện</span></p>\n<p><span style=\"font-weight: 400;\">✦ Màu : Đen bên trong màu Cam</span></p>\n<p><span style=\"font-weight: 400;\">✦ Phù hợp đi học, đi chơi, đi phượt, dã ngoại, đi học,</span></p>\n<p><span style=\"font-weight: 400;\">✦ Form túi chuẩn, bo viền chắc chắn, đường chỉ may tỉ mỉ song song 2 đường</span></p>\n<p><span style=\"font-weight: 400;\">✦ Dây đêo đan chắc chắn không xù</span></p>\n<p><span style=\"font-weight: 400;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://salt.tikicdn.com/ts/tmp/18/15/3f/f79c62d219d1a2f3653d1af4cef10946.png\" alt=\"\" width=\"750\" height=\"750\" /></span></p>\n<p><span style=\"font-weight: 400;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://salt.tikicdn.com/ts/tmp/e3/01/18/b1434dd5fdd4a83b385b808d4728819c.png\" alt=\"kích thước túi đeo chéo td3-\" width=\"750\" height=\"750\" /></span></p>\n<p><span style=\"font-weight: 400;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://salt.tikicdn.com/ts/tmp/0e/42/03/a366c853f23a56de77e84399a1de9b74.png\" alt=\"dây đeo cao cấp\" width=\"750\" height=\"750\" /></span></p>\n<p><span style=\"font-weight: 400;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://salt.tikicdn.com/ts/tmp/c8/04/a8/fac281fc8abd5843cfcfb049127b5d67.png\" alt=\"túi đeo chéo td30 nhiều ngăn\" width=\"671\" height=\"671\" /></span></p>\n<p><span style=\"font-weight: 400;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://salt.tikicdn.com/ts/tmp/43/86/ef/281093e615434f3df01ad197dfb896d1.jpg\" alt=\"túi đeo chéo td30 chống nước\" width=\"750\" height=\"750\" /></span></p>\n<p><span style=\"font-weight: 400;\">_____________</span></p>\n<p><strong>III. HƯỚNG DẪN BẢO QUẢN TÚI ĐEO CHÉO</strong></p>\n<p><span style=\"font-weight: 400;\">✦ Không nên để sản phẩm tiếp xúc nhiều với xà bông.</span></p>\n<p><span style=\"font-weight: 400;\">✦ Có thể vệ sinh bằng khăn ẩm và các dung dịch làm sạch đã pha loãng.</span></p>\n<p><span style=\"font-weight: 400;\">✦ Trong trường hợp không có sẵn dung dịch làm sạch, có thể pha loãng dầu gội đầu và lau sản phẩm nhẹ nhàng với khăn sạch hoặc dùng cồn cùng một chút ít xà phòng để chà nhẹ lên bề mặt vết bẩn.</span></p>\n<p><span style=\"font-weight: 400;\">✦ Lau khô hoàn toàn sau khi vệ sinh.</span></p>\n<p> </p>\n<p><span style=\"font-weight: 400;\">LƯU Ý</span></p>\n<p><span style=\"font-weight: 400;\">Qúy khách hàng cẩn trọng với những mẫu túi thiết kế tương tự nhưng chất lượng vải kém, vải thô</span></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p><p>Sản phẩm này là tài sản cá nhân được bán bởi Nhà Bán Hàng Cá Nhân và không thuộc đối tượng phải chịu thuế GTGT. Do đó hoá đơn VAT không được cung cấp trong trường hợp này.</p>','2020-10-16',2,11,9),(30,'Ví Bóp Vải Canvas JOHZEON Kiểu Dáng Hàn Quốc Nhiều Ngăn Bền Bỉ Tiện Lợi DV100','<p><img src=\"https://salt.tikicdn.com/ts/tmp/55/1b/f2/9eb0a242311e5e97c92e87e1ac8f509c.jpg\" alt=\"\" width=\"750\" height=\"763\" /></p>\n<p style=\"text-align:center;\">Ví Bóp Vải Canvas JOHZEON Kiểu Dáng Hàn Quốc Nhiều Ngăn Bền Bỉ Tiện Lợi DV100</p>\n<p>- Chất Liệu : Vải Canvas cao cấp bền bỉ theo thời gian</p>\n<p>- Kiểu Dáng : Ví ngang</p>\n<p>- Kích thước ví: 11,5x10cm</p>\n<p>- Ngăn túi : Ví có 2 ngăn lớn và nhiều ngăn nhỏ